  const [user, setUser] = useState(null);
  useEffect(() => {
    fetch('https://gitconnected.com/v1/portfolio/kforchuk')
    .then(response => response.json())
    .then(user => {
      setUser(user);
    });
  },[]);
if (!user) {
  return <div />;
}
  return <Pages user={user} />;
}

